import React, {useState} from "react";


function Subject(info, index){

    return(
        <div className={"subject "+ (info.open ? "open": "")}
            key={index}
        >
            <div className={"subject__heading"}>
                {info.subject}
            </div>
            {
                info.chapters.map((chapter) =>{
                    return(
                        <div className={"subject__topic"}>
                            {chapter};
                        </div>
                    );
                })
            }

        </div>
    );
}
export default Subject;
